package JavaPrograms;

public class SwapString {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		String S1 = "Anusha";
		String S2 = "Chetan";
		String S3 = "";
		
		S3 = S1;
		S1 = S2;
		S2 = S3;
		
		System.out.println(S1);
		System.out.println(S2);
		
		int a=10;
		int b=20;
		
		a=a+b;
		b=a-b;
		a=a-b;
		System.out.println(a);
		System.out.println(b);

	}

}
